(10035, 0, 'PLG_SYSTEM_JACAMPAIGN', 'plugin', 'jacampaign', '', 'system', 0, 0, 1, 0, '{\"name\":\"PLG_SYSTEM_JACAMPAIGN\",\"type\":\"plugin\",\"creationDate\":\"Mar 28th, 2024\",\"author\":\"JoomlArt.com\",\"copyright\":\"J.O.O.M Solutions Co., Ltd.\",\"authorEmail\":\"webmaster@joomlart.com\",\"authorUrl\":\"www.joomlart.com\",\"version\":\"1.0.1\",\"description\":\"PLG_SYSTEM_JACAMPAIGN_DESCRIPTION\",\"group\":\"\",\"filename\":\"jacampaign\"}', '{\"email_resgitration_subject\":\"Please activate your account\",\"email_resgitration_body\":\"<!DOCTYPE HTML PUBLIC \\\"-\\/\\/W3C\\/\\/DTD HTML 4.01 Transitional\\/\\/EN\\\">\\r\\n<html>\\r\\n<head><meta http-equiv=\\\"content-type\\\" content=\\\"text\\/html; charset=utf-8\\\">\\r\\n\\t<style type=\\\"text\\/css\\\">body {font-family: sans-serif; font-size: 15px; color: #232f3f; font-weight: 400; margin: 0; padding: 40px 0; line-height: 1.6;}\\r\\n  table {border-collapse: collapse; border-spacing: 0;}\\r\\n\\t<\\/style>\\r\\n<\\/head>\\r\\n<body style=\\\"background-color: #f6f6f6; text-align: center; padding: 30px 0;\\\">\\r\\n<table style=\\\"width: 596px; margin: 0 auto;\\\"><!-- Header -->\\r\\n\\t<tbody>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align: center; padding: 30px;\\\"><a href=\\\"https:\\/\\/www.joomlart.com\\\" style=\\\"display: inline-block; width: 200px;\\\" title=\\\"JoomlArt\\\"><img alt=\\\"JoomlArt\\\" src=\\\"https:\\/\\/www.joomlart.com\\/content\\/themes\\/dw-unite\\/assets\\/img\\/joomlart-dark.png\\\" style=\\\"max-width: 100%; opacity: 0.5;\\\" \\/><\\/a><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<!-- End: Header --><!-- Begin: Body -->\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"background-color: #fff; border: 1px solid #eee; border-bottom-width: 2px; font-size: 16px; line-height: 1.5;\\\">\\r\\n\\t\\t\\t<table>\\r\\n\\t\\t\\t\\t<tbody>\\r\\n\\t\\t\\t\\t\\t<tr>\\r\\n\\t\\t\\t\\t\\t\\t<td><img alt=\\\"\\\" src=\\\"https:\\/\\/static.joomlart.com\\/images\\/blog\\/2020\\/stay-safe.jpg\\