font-weight: 500; color: #999;\\\">Sincerely,<br \\/>\\r\\n\\t\\t\\t\\t\\t\\tHung Dinh<br \\/>\\r\\n\\t\\t\\t\\t\\t\\tCEO, JoomlArt<\\/td>\\r\\n\\t\\t\\t\\t\\t<\\/tr>\\r\\n\\t\\t\\t\\t<\\/tbody>\\r\\n\\t\\t\\t<\\/table>\\r\\n\\t\\t\\t<\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<!-- End: Body --><!-- Begin: Footer -->\\r\\n\\t\\t\\r\\n\\t<\\/tbody>\\r\\n<\\/table>\\r\\n<\\/body>\\r\\n<\\/html>\\r\\n\",\"email_activation_subject\":\"New user register on JoomlArt COVID Campaign\",\"email_activation_body\":\"<p>Hey admin,<\\/p>\\r\\n\\r\\n<p>New user registered on the COVID Support campaign. User details:<\\/p>\\r\\n<ul>\\r\\n\\t<li>Name: {name}<\\/li>\\r\\n<\\/ul>\",\"email_submitoffer_subject\":\"Your offer has been submitted successfully\",\"email_submitoffer_body\":\"<!DOCTYPE HTML PUBLIC \\\"-\\/\\/W3C\\/\\/DTD HTML 4.01 Transitional\\/\\/EN\\\">\\r\\n<html>\\r\\n<head><meta http-equiv=\\\"content-type\\\" content=\\\"text\\/html; charset=utf-8\\\">\\r\\n\\t<style type=\\\"text\\/css\\\">body {font-family: sans-serif; font-size: 15px; color: #232f3f; font-weight: 400; margin: 0; padding: 40px 0; line-height: 1.6;}\\r\\n  table {border-collapse: collapse; border-spacing: 0;}\\r\\n\\t<\\/style>\\r\\n<\\/head>\\r\\n<body style=\\\"background-color: #f6f6f6; text-align: center; padding: 30px 0;\\\">\\r\\n<table style=\\\"width: 596px; margin: 0 auto;\\\"><!-- Header -->\\r\\n\\t<tbody>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align: center; padding: 30px;\\\"><a href=\\\"https:\\/\\/www.joomlart.com\\\" style=\\\"display: inline-block; width: 200px;\\\" title=\\\"JoomlArt\\\"><img alt=\\\"JoomlArt\\\" src=\\\"https:\\/\\/www.joomlart.com\\/content\\/themes\\/dw-unite\\/assets\\/img\\/joomlart-dark.png\\\" style=\\\"max-width: 100%; opacity: 0.5;\\\" \\/><\\/a><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<!-- End: Header --><!-- Begin: Body -->\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"background-color: #fff; border: 1px solid #eee; border-bottom-width: 2px; font-size: 16px; line-height: 1.5;\\\">\\r\\n\\t\\t\\t<table>\\r\\n\\t\\t\\t\\t<tbody>\\r\\n\\r\\n\\t\\t\\t\\t\\t<tr>\\r\\n\\t\\t\\t\\t\\t\\t<td style=\\\"padding: 40px; padding-top:20px; line-height: 1.5; text-align: left;\\\">\\r\\n\\t\\t\\t\\t\\t\\t<h2 style=\\\"font-size: 20px; line-height:1.6; text-align: center;\\\"><span style=\\\"font-size:20px; color:#1f39c2;\\\">Your offer is submitted \\ud83d\\udc4c<span style=\\\"height:5px; width:60px; border-radius:50px; background: #1f39c2; font-size:0; margin: 10px auto; display: block;\\\">-<\\/span><\\/span><\\/h2>\\r\\n\\r\\n\\t\\t\\t\\t\\t\\t<p>Hi,<\\/p>\\r\\n\\r\\n\\t\\t\\t\\t\\t\\t<p>Thank you for joining our Covid Support campaign for the Joomla community.<\\/p>\\r\\n\\r\\n\\t\\t\\t\\t\\t\\t<p>We got your offer submission, our team will review your offer and if it is valid offer, we will publish and list your offer in the campaign offer list main page <a href=\\\"https:\\/\\/covid.joomlart.com\\/\\\">HERE<\\/a><\\/p>\\r\\n\\t\\t\\t\\t\\t\\t<p>You should get notification email when your offer is published.<\\/p>\\r\\n\\r\\n\\t\\t\\t\\t\\t\\t<p>Thanks again for being with us to do the helpful campaign during the epidemic.<\\/p> \\r\\n\\r\\n\\t\\t\\t\\t\\t\\t<\\/td>\\r\\n\\t\\t\\t\\t\\t<\\/tr>\\r\\n\\t\\t\\t\\t\\t<tr>\\r\\n\\t\\t\\t\\t\\t\\t<td style=\\\"border-top: 1px solid #eee; padding: 20px 30px 20px; text-align: right; line-height: 1.5; font-weight: 500; color: #999;\\\">Sincerely,<br \\/>\\r\\n\\t\\t\\t\\t\\t\\tHung Dinh<br \\/>\\r\\n\\t\\t\\t\\t\\t\\tCEO, JoomlArt<\\/td>\\r\\n\\t\\t\\t\\t\\t<\\/tr>\\r\\n\\t\\t\\t\\t<\\/tbody>\\r\\n\\t\\t\\t<\\/table>\\r\\n\\t\\t\\t<\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<!-- End: Body --><!-- Begin: Footer -->\\r\\n\\t\\t\\r\\n\\t<\\/tbody>\\r\\n<\\/table>\\r\\n<\\/body>\\r\\n<\\/html>\\r\\n\",\"email_to_admin_subject\":\"New offer submitted.\",\"email_to_admin_body\":\"<!DOCTYPE HTML PUBLIC \\\"-\\/\\/W3C\\/\\/DTD HTML 4.01 Transitional\\/\\/EN\\\">\\r\\n<html>\\r\\n<head><meta http-equiv=\\\"content-type\\\" content=\\\"text\\/html; charset=utf-8\\\">\\r\\n\\t<style type=\\\"text\\/css\\\">body {font-family: sans-serif; font-size: 15px; color: #232f3f; font-weight: 400; margin: 0; padding: 40px 0; line-height: 1.6;}\\r\\n  table {border-collapse: collapse; border-spacing: 0;}\\r\\n\\t<\\/style>\\r\\n<\\/head>\\r\\n<body style=\\\"background-color: #f6f6f6; text-align: center; padding: 30px 0;\\\">\\r\\n<table style=\\\"width: 596px; margin: 0 auto;\\\"><!-- Header -->\\r\\n\\t<tbody>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"text-align: center; padding: 30px;\\\"><a href=\\\"https:\\/\\/www.joomlart.com\\\" style=\\\"display: inline-block; width: 200px;\\\" title=\\\"JoomlArt\\\"><img alt=\\\"JoomlArt\\\" src=\\\"https:\\/\\/www.joomlart.com\\/content\\/themes\\/dw-unite\\/assets\\/img\\/joomlart-dark.png\\\" style=\\\"max-width: 100%; opacity: 0.5;\\\" \\/><\\/a><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<!-- End: Header --><!-- Begin: Body -->\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td style=\\\"background-color: #fff; border: 1px solid #eee; border-bottom-width: 2px; font-size: 16px; line-height: 1.5;\\\">\\r\\n\\t\\t\\t<table>\\r\\n\\t\\t\\t\\t<tbody>\\r\\n\\t\\t\\t\\t\\t<tr>\\r\\n\\t\\t\\t\\t\\t\\t<td style=\\\"padding: 40px; padding-top:20px; line-height: 1.5; text-align: left;\\\">\\r\\n\\t\\t\\t\\t\\t\\t<h2 style=\\\"font-size: 20px; line-height:1.6; text-align: center;\\\"><span style=\\\"font-size:20px; color:#1f39c2;\\\">New submission waiting for your approval<span style=\\\"height:5px; width:60px; border-radius:50px; background: #1f39c2; font-size:0; margin: 10px auto; display: block;\\\">-<\\/span><\\/span><\\/h2>\\r\\n\\r\\n\\t\\t\\t\\t\\t\\t<p>A new offer submission is submitted with the details below:<\\/p>\\r\\n\\t\\t\\t\\t\\t\\t<ul>\\r\\n\\t\\t\\t\\t\\t\\t\\t<li>Title: {title}<\\/li>\\r\\n\\t\\t\\t\\t\\t\\t\\t<li>Offer: {offer}<\\/li>\\r\\n\\t\\t\\t\\t\\t\\t<\\/ul>\\r\\n\\r\\n\\t\\t\\t\\t\\t\\t<p>Access admin dashboard and go to Content > Articles and review offer for new user. After publish, please notify users.<\\/p>\\r\\n\\r\\n\\r\\n\\t\\t\\t\\t\\t\\t<\\/td>\\r\\n\\t\\t\\t\\t\\t<\\/tr>\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t<\\/tbody>\\r\\n\\t\\t\\t<\\/table>\\r\\n\\t\\t\\t<\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<!-- End: Body --><!-- Begin: Footer -->\\r\\n\\t\\t\\r\\n\\t<\\/tbody>\\r\\n<\\/table>\\r\\n<\\/body>\\r\\n<\\/html>\\r\\n\",\"modal_popup\":\"1\",\"modal_title\":\"\",\"modal_description\":\"<div class=\\\"message lead text-center\\\">\\r\\n            Just 1 click, help us share the campaign to support more users <span style=\\\"color: #fd0000;\\\"><i class=\\\"fas fa-heart\\\"><\\/i><\\/span>.\\r\\n          <\\/div>\\r\\n          <!-- Go to www.addthis.com\\/dashboard to customize your tools -->\\r\\n          <div class=\\\"addthis_sharing_toolbox\\\"><\\/div> \",\"modal_duration\":\"15\"}', '', NULL, NULL, 0, 0, NULL, 0),
